import { Component } from "react";
import "./card.styles.css"

class Card extends Component{
    render(){
        const { name, image, email,lat, long } = this.props;
        return(
        <div className="card-container">
            <h1>{name}</h1>
            <img src={image} alt="" />
            <h3>{email}</h3>
            <h4>Geographic Location:</h4>
            <ul>
                <li>Lat: {lat}</li>
                <li>Long: {long}</li>
            </ul>
        </div>
        )
    }
}
export default Card;
